, "video_id": "zGgVgERbVHk"}, {"id": "UgxoNUKf61ch6GYCQdZ4AaABAg.AHRRgNSDcjAAO8heCOeYD3", "text": "Lol lmao \ud83e\udd23 \ud83d\ude02 \ud83d\ude06 \ud83d\ude05", "author": "@Earl_Wallace", "like_count": 1, "published_at": "2025-10-11T16:04:40Z", "parent_id": "UgxoNUKf61ch6GYCQdZ4AaABAg", "video_id": "zGgVgERbVHk"}, {"id": "UgxoNUKf61ch6GYCQdZ4AaABAg.AHRRgNSDcjAAPL12GFXeqj", "text": "Lived there for four years, it was awful!", "author": "@mcqueendroid", "like_count": 2, "published_at": "2025-11-10T07:25:08Z", "parent_id": "UgxoNUKf61ch6GYCQdZ4AaABAg", "video_id": "zGgVgERbVHk"}, {"id": "UgzUW-7L_hUdntlx1SN4AaABAg", "text": "No thanks", "author": "@visualizecreate2530", "like_count": 2, "published_at": "2025-03-31T04:46:51Z", "parent_id": null, "video_id": "zGgVgERbVHk"}, {"id": "UgynI9AIrkUBBqzKRZl4AaABAg", "text": "Thinking of buying or selling in Orange County? Let''s connect! \ud83d\udcf2 714-402-4212  \ud83d\udce7monica@monicacarr.com", "author": "@MonicaCarrRealEstateGroup", "like_count": 1, "published_at": "2023-09-20T20:42:50Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "Ugwnm__tss9Gq9Z0Msx4AaABAg", "text": "I''ve lived in Irvine since 1982 and I love it", "author": "@DrJenniferY", "like_count": 1, "published_at": "2025-12-16T21:02:31Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "UgwaaASVtnPtbT_CPg14AaABAg", "text": "This video is fantastic! I hope to see more like this in the future!", "author": "@BodhiMontgomery", "like_count": 1, "published_at": "2025-07-04T14:32:49Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "UgxNuFdTSLkZEIFsURd4AaABAg", "text": "Thanks for putting so much effort into your videos. You''re amazing!", "author": "@LeoValencia-y4b", "like_count": 1, "published_at": "2025-07-04T14:21:25Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "Ugx6A0n1YIb0PEvSqA14AaABAg", "text": "You explained everything so well, I really appreciate it!", "author": "@CrewMontgomery", "like_count": 1, "published_at": "2025-07-04T14:18:58Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "UgzsF_bCps_gC0wx6rB4AaABAg", "text": "This video was so helpful, thank you for sharing your knowledge! \ud83d\ude4f", "author": "@RubenAlves-i9n", "like_count": 1, "published_at": "2025-07-02T11:37:36Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "Ugy4D1w07yoNreKMw754AaABAg", "text": "This city was an awesome place to grow up. Not as good as it used to be.", "author": "@jujitsuman9934", "like_count": 1, "published_at": "2025-06-13T07:41:28Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "Ugy32Q3zUTuYqFxO93R4AaABAg", "text": "Is Irvine CA walkable city?", "author": "@SunShineLady-d4r", "like_count": 1, "published_at": "2025-05-25T13:52:15Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "Ugy32Q3zUTuYqFxO93R4AaABAg.AIYZ-jGNdEyAId87N-PgUF", "text": "That depends on what area you live in! Some neighborhoods border the Jeffery Open Space trail, which provides walking paths for miles across the city.", "author": "@MonicaCarrRealEstateGroup", "like_count": 1, "published_at": "2025-05-27T17:52:48Z", "parent_id": "Ugy32Q3zUTuYqFxO93R4AaABAg", "video_id": "0JZmAXoNUDw"}, {"id": "UgxdttYDcZaxxr0fzQJ4AaABAg", "text": "I''ve been to Irvine California its soulless and sterile", "author": "@clownsleftjokersright7027", "like_count": 0, "published_at": "2025-01-29T00:08:36Z", "parent_id": null, "video_id": "0JZmAXoNUDw"}, {"id": "UgzrlZiuo6vvYoBjcwN4AaABAg", "text": "I love Woodbridge =) That''s why I sold my home in Stonegate and moved back to Woodbridge.", "author": "@jamesnguyen", "like_count": 0, "published_at": "2025-06-26T16:38:26Z", "parent_id": null, "video_id": "_QMypwMP0Bs"}, {"id": "Ugy5aq0gmz2pOpwrkzN4AaABAg", "text": "Irvine is the type of place where a security guard will pull you over for your car being dirty, and it\u2019s all Asians and middle eastern people and the entire city is owned by a company \ud83d\ude02\ud83d\udc4e", "author": "@kaveh1836", "like_count": 1, "published_at": "2025-02-03T02:03:58Z", "parent_id": null, "video_id": "_QMypwMP0Bs"}, {"id": "Ugztxo6XxKEnSL2sjVZ4AaABAg", "text": "used to be great, now, not so much. also horrible people and bad drivers. moved away and thank God I did.", "author": "@thelastninja4825", "like_count": 2, "published_at": "2025-02-01T17:09:47Z", "parent_id": null, "video_id": "_QMypwMP0Bs"}, {"id": "Ugztxo6XxKEnSL2sjVZ4AaABAg.AE-wmb1XoWAAE3TnHwSyM8", "text": "Irvine sucks!!!!!", "author": "@kaveh1836", "like_count": 0, "published_at": "2025-02-03T02:04:41Z", "parent_id": "Ugztxo6XxKEnSL2sjVZ4AaABAg", "video_id": "_QMypwMP0Bs"}, {"id": "Ugztxo6XxKEnSL2sjVZ4AaABAg.AE-wmb1XoWAAE3_96xZCJE", "text": "@kaveh1836  tell  me about it ...", "author": "@thelastninja4825", "like_count": 0, "published_at": "2025-02-03T03:00:14Z", "parent_id": "Ugztxo6XxKEnSL2sjVZ4AaABAg", "video_id": "_QMypwMP0Bs"}, {"id": "UgwB2G9xSBP_zURSseF4AaABAg", "text": "Parts of Northwood have no HOA and no Mello Roos!", "author": "@Nightpanda400", "like_count": 1, "published_at": "2025-01-30T18:13:10Z", "parent_id": null, "video_id": "_QMypwMP0Bs"}, {"id": "UgwB2G9xSBP_zURSseF4AaABAg.ADvuS5HB-MBAE-ww_Gnvgw", "text": "Northwood went down hill several years ago after building 4 new apartment complexes", "author": "@thelastninja4825", "like_count": 0, "published_at": "2025-02-01T17:11:08Z", "parent_id": "UgwB2G9xSBP_zURSseF4AaABAg", "video_id": "_QMypwMP0Bs"}, {"id": "UgxjW2EfjHqywlGkfJt4AaABAg", "text": "I remember articles about toxic materials in the soil, found during construction in Irvine. Which area is that?\nThanks", "author": "@Mariya2804", "like_count": 1, "published_at": "2025-01-30T04:09:38Z", "parent_id": null, "video_id": "_QMypwMP0Bs"}, {"id": "UgxjW2EfjHqywlGkfJt4AaABAg.ADuOuviWsZ6AE-wrQ_AzsG", "text": "near the old air base on the east side. stay away", "author": "@thelastninja4825", "like_count": 2, "published_at": "2025-02-01T17:10:26Z", "parent_id": "UgxjW2EfjHqywlGkfJt4AaABAg", "video_id": "_QMypwMP0Bs"}, {"id": "UgxjW2EfjHqywlGkfJt4AaABAg.ADuOuviWsZ6AHro53khc3L", "text": "El Toro base? Where Grand Park now is?", "author": "@debbiem6406", "like_count": 0, "published_at": "2025-05-08T14:06:12Z", "parent_id": "UgxjW2EfjHqywlGkfJt4AaABAg", "video_id": "_QMypwMP0Bs"}, {"id": "Ugx--GOw_QyVQ560E314AaABAg", "text": "8:20 assigned and 8:38 very difficult for someone to drive in and use grill. street parking are for guests and you have to have a pass on your car bc they monitor CONSTANTLY, meaning no time trying to drive in and use the grill", "author": "@rockyrodes5", "like_count": 0, "published_at": "2026-02-11T23:26:39Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "Ugx--GOw_QyVQ560E314AaABAg.AT6D-vsTHzJATBece6kABl", "text": "Really???? They told us that we don\u2019t even need to register overnight guests \ud83d\ude02\ud83d\ude02\ud83d\ude02", "author": "@theamericanexplorer", "like_count": 0, "published_at": "2026-02-14T02:12:56Z", "parent_id": "Ugx--GOw_QyVQ560E314AaABAg", "video_id": "srt2NuMUmpk"}, {"id": "Ugx_SBkM3eJCHRl0F2l4AaABAg", "text": "Don\u2019t do it find another place another state", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:17:28Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgzskPqRyemqVIE5NnR4AaABAg", "text": "Welcome to California. Welcome to Orange County the Irvine development company building huge compounds to shuffling people. That is their goal. Heavy taxes have a government and you will get nothing.", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:12:24Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgwBv8B2eGpjpqi2XNt4AaABAg", "text": "Just one big heaping mound of regret why would you don\u2019t do it?", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:10:58Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgwwmASSGpLUE9uHz2Z4AaABAg", "text": "I hope you love taxes and heavy government. Enjoy", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:06:56Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgyCf_tuMyymtLshQjl4AaABAg", "text": "Why would you buy a property in California?\ud83d\ude02 What an absolute joke", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:06:30Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgyCf_tuMyymtLshQjl4AaABAg.APFWigIS6dNAT6DJ1Qk3oR", "text": "irvine company doesn''t do condos. these are all rentals.", "author": "@rockyrodes5", "like_count": 0, "published_at": "2026-02-11T23:29:15Z", "parent_id": "UgyCf_tuMyymtLshQjl4AaABAg", "video_id": "srt2NuMUmpk"}, {"id": "UgwEJXVJdrAg9Zo9bxd4AaABAg", "text": "\u2705 You might enjoy watching my video on Crystal Cove: https://youtu.be/n6cIfZeH4AI\r\n\u2705 Or Laguna Beach: https://youtu.be/Ek55xJ2md5E", "author": "@YellowProductions", "like_count": 4, "published_at": "2024-12-14T04:46:18Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "UgwwZRKq-Rulm0RqrUN4AaABAg", "text": "Habit is better than In-N-Out", "author": "@papagen00", "like_count": 0, "published_at": "2025-12-29T22:17:06Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "UgxqP3veKEKdUXzDqS14AaABAg", "text": "Irvine company is the worst", "author": "@negrobeard", "like_count": 0, "published_at": "2025-12-28T06:10:21Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "Ugx_CoW_4zp_7Ou7rb94AaABAg", "text": "Thank you Sir \u2764\u2764\u2764\u2764", "author": "@kimyoung3484", "like_count": 2, "published_at": "2025-08-11T20:30:28Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "UgyWImsnajBNXf6SmEN4AaABAg", "text": "This is not. BIG mall as stated, it\u2019s okay. Beautiful spot but not much shopping options as an indoor mall.", "author": "@rcsc824sc8", "like_count": 0, "published_at": "2025-06-29T16:07:55Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "Ugx1DKwXJkO4yGFvpL54AaABAg", "text": "Very Wonderful Shopping Center Video!!! I Love the Fountains!!!! F+L, Corey", "author": "@coreycoyle9548", "like_count": 4, "published_at": "2025-06-21T17:03:23Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "Ugxh91Pu-6Byrk6-wDp4AaABAg", "text": "Be careful of that Cheesecake location. Got food poisoning there.", "author": "@Jenn_Jenn-w5i", "like_count": 0, "published_at": "2025-05-31T19:08:37Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "UgxqQlnWff1lzcQ1wk94AaABAg", "text": "I was from the Orange County area. I lived thier for 11 years and the Irvine Spectrum was one of my favorite spots to go shopping.", "author": "@matteocarlini27", "like_count": 4, "published_at": "2025-05-12T20:08:43Z", "parent_id": null, "video_id": "npR2EkyPXbo"}, {"id": "UgxqQlnWff1lzcQ1wk94AaABAg.AI1kkhc7uNIAIfahZXgjn-", "text": "I''m from London and I want to move to California why did you move out if I may ask", "author": "@Offline.e.e.e", "like_count": 0, "published_at": "2025-05-28T16:49:46Z", "parent_id": "UgxqQlnWff1lzcQ1wk94AaABAg", "video_id": "npR2EkyPXbo"}, {"id": "UgxqQlnWff1lzcQ1wk94AaABAg.AI1kkhc7uNIAIg9cNlGdgp", "text": "@Offline.e.e.eI am still in California, I moved from Southern California because my mom got a job in Northern California", "author": "@matteocarlini27", "like_count": 0, "published_at": "2025-05-28T22:03:38Z", "parent_id": "UgxqQlnWff1lzcQ1wk94AaABAg", "video_id": "npR2EkyPXbo"}, {"id": "UgzAZoMjP5ccctyD7PF4AaABAg", "text": "Been there in 2019 and 2023 awsome, love it", "author": "@HimmelKing", "like_count": 2, "published_at": "2025-10-18T18:52:01Z", "parent_id": null, "video_id": "zE70xFDLzLk"}, {"id": "UgzAZoMjP5ccctyD7PF4AaABAg.AOR1N1HWkESAOUvjVFM6c7", "text": "Thank you for watching ", "author": "@LeisurePilot", "like_count": 1, "published_at": "2025-10-20T07:11:01Z", "parent_id": "UgzAZoMjP5ccctyD7PF4AaABAg", "video_id": "zE70xFDLzLk"}, {"id": "UgzAZoMjP5ccctyD7PF4AaABAg.AOR1N1HWkESAOYvYrDQC9K", "text": "@LeisurePilotI reccomended this to a friend who is on an exchange to the us rn", "author": "@HimmelKing", "like_count": 1, "published_at": "2025-10-21T20:26:23Z", "parent_id": "UgzAZoMjP5ccctyD7PF4AaABAg", "video_id": "zE70xFDLzLk"}, {"id": "UgzAZoMjP5ccctyD7PF4AaABAg.AOR1N1HWkESAOZIvybp_Kc", "text": "@HimmelKing You''re a wonderful person, thank you kindly. I hope your friend has a fantastic exchange experience!", "author": "@LeisurePilot", "like_count": 1, "published_at": "2025-10-21T23:59:24Z", "parent_id": "UgzAZoMjP5ccctyD7PF4AaABAg", "video_id": "zE70xFDLzLk"}, {"id": "UgzAZoMjP5ccctyD7PF4AaABAg.AOR1N1HWkESAOaNxog6W-u", "text": "@LeisurePilothe\u2019s going on the 24th, I hope he has fun too \ud83d\udc40", "author": "@HimmelKing", "like_count": 1, "published_at": "2025-10-22T19:21:49Z", "parent_id": "UgzAZoMjP5ccctyD7PF4AaABAg", "video_id": "zE70xFDLzLk"}, {"id": "Ugyqdlgr-A90x_VhPA54AaABAg", "text": "The Irvine Group/ Irvine spectrum -- NICE SHADE \ud83c\udf1e SAILS,,\nSincerely.", "author": "@frauwolftherehorse", "like_count": 1, "published_at": "2025-08-17T22:23:50Z", "parent_id": null, "video_id": "zE70xFDLzLk"}, {"id": "UgzTTJyb8aF-pcvuY4Z4AaABAg", "text": "Thank you. I really appreciate \ud83d\ude4f your video. I had looked at several Irvine Company apartments a few years ago. But I was not in a position to afford one. Center Point, after seeing your video is now my favorite. I do remember going there and how pretty the community is, resort like, greenery, stunning property. As you said, it is like it''s own City. Second choice which I saw was The Park. I had seem more, but these two are still my top two. I will go back to work this year 2024 or early 2025. Planning to go see these two apartments, probably will pick Center Point, as it has more to offer. \nBoth truly beautiful complexes.", "author": "@cm9859", "like_count": 1, "published_at": "2024-05-18T19:14:46Z", "parent_id": null, "video_id": "SV-_KOL3Vf4"}]', 0.5, '{"sources": {"zori_csv": false, "overpass_grocery": true, "overpass_night_activity": false, "overpass_noise": tru