207\r\n\ud83d\udce7Email:  info@livinginirvinecalifornia.com\r\n\ud83d\udcc5Zoom:  http://bit.ly/3ZeNnEa\r\n Full Channel: \ud83d\udc49\ud83d\udc49\ud83d\udc49: https://bit.ly/3NXecX3\r\n=======", "author": "@LivinginIrvineCalifornia", "like_count": 1, "published_at": "2023-01-23T02:40:51Z", "parent_id": null, "video_id": "84vX4334odw"}, {"id": "Ugx-sSEW5lPJ2iG2UHR4AaABAg", "text": "In Woodbridge, we are representing owners in the leasing of a beautiful 4 bedroom, single family home at 70 Summerstone. Very nice upgrades, spacious backyard:  love living in Woodbridge by leasing 70 Summerstone!\n\nhttps://www.bruceclarkgroup.com/listing-detail/1170134714/70-Summerstone-Irvine-CA\n\n#woodbridgeirvine #bruceclark #realbroker #homeforlease", "author": "@LivinginIrvineCalifornia", "like_count": 0, "published_at": "2025-10-02T00:35:11Z", "parent_id": null, "video_id": "84vX4334odw"}, {"id": "UgzLnuQixuClgf6K8h14AaABAg", "text": "We love Irvine and Woodbridge has so many great things to offer residents. As of 10/1/2025, we have two properties available in Woodbridge:  43 Glenhurst, which is being offered for sale or for lease. A very nicely-upgraded 3 bedroom condo.\n\nhttps://www.bruceclarkgroup.com/listing-detail/1166293290/43-Glenhurst-Irvine-CA\n\n#IrvineCondo #condoforlease #irvinerealestate #woodbridge", "author": "@LivinginIrvineCalifornia", "like_count": 0, "published_at": "2025-10-02T00:32:09Z", "parent_id": null, "video_id": "84vX4334odw"}, {"id": "UgzXiGW3h07I8XRT1Xh4AaABAg", "text": "I live in Woodbridge and I LOVE it \ud83d\ude0a", "author": "@DrJenniferY", "like_count": 0, "published_at": "2025-12-16T23:46:23Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "UgxZkA8XysvS4sVEyj54AaABAg", "text": "I grew up in the houses along the lake in the beginning of the video.  I forgot if it was either north or south lake. It was in the 80s. Went to stonecreek elementary.  It was such a fun time.  I miss it. \ud83d\ude22", "author": "@SPChef1981", "like_count": 1, "published_at": "2022-11-22T15:27:51Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "UgwjLtfwZW1QUE-SI8h4AaABAg", "text": "Thanks for the video.  I grew up in Woodbridge. Went to Eastshore elementary and lake side middle school. Haven''t seen cali in a minute thanks again.", "author": "@DaProblem850", "like_count": 1, "published_at": "2022-04-10T20:59:20Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "UgzXMkop908aVOnMKLl4AaABAg", "text": "Do a video on Great Park Neighborhoods", "author": "@kasufert", "like_count": 0, "published_at": "2022-02-24T07:15:16Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "UgzXMkop908aVOnMKLl4AaABAg.9YoznS30RIq9YpQntJtNxs", "text": "Wait just realized you already have one on it lol", "author": "@kasufert", "like_count": 0, "published_at": "2022-02-24T11:20:00Z", "parent_id": "UgzXMkop908aVOnMKLl4AaABAg", "video_id": "U3HD51SY76Q"}, {"id": "Ugxv6piQI6LLvHU_HRV4AaABAg", "text": "Nice content! The theme song from the OC plays in my head every time I see y''all. Maybe it''s a sign?", "author": "@TheKevinNewsom", "like_count": 1, "published_at": "2021-12-25T03:21:59Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "UgxoygHISmWeRBUzLU14AaABAg", "text": "We bought our 4 bedroom home down here in Laguna Hills back in 2009 for 500K and the price has doubled now. Best place to live with no HOA or Mello Roos tax.", "author": "@LagunaRider1961", "like_count": 2, "published_at": "2021-12-24T20:16:31Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "UgwIEDS_I4vkR8d7D1F4AaABAg", "text": "Great videos! Love your content! I just think it gets too chilly in the winter near the beach especially how it is more windy with the cold sea breeze. During summer it''s perfect to me though. I prefer inland during winter due to higher warmer daytime Temps compared to the daytime Temps near the beach areas during winter or cold months.", "author": "@GregoryMorales-uo6ze", "like_count": 0, "published_at": "2021-12-24T00:59:16Z", "parent_id": null, "video_id": "U3HD51SY76Q"}, {"id": "Ugx6ETfVgmTG6WzZFZx4AaABAg", "text": "Thanks for this review,  would you be able to speak on your experience with noise level at this complex?  I keep seeing reviews of thin walls and loud landscaping early in the morning.", "author": "@bubbiesadventures", "like_count": 1, "published_at": "2023-02-13T18:13:53Z", "parent_id": null, "video_id": "aDaS_v-SkNQ"}, {"id": "Ugx6ETfVgmTG6WzZFZx4AaABAg.9m4gZyuYyZO9m4r4prMhqL", "text": "With majority of new apartment complexes due to cutting costs and making higher margin, unfortunately the noise is high. Depending on which side you reside it can be less noise, ex: top floor on the side with no one next to it", "author": "@JohnnyKReviews", "like_count": 0, "published_at": "2023-02-13T19:45:45Z", "parent_id": "Ugx6ETfVgmTG6WzZFZx4AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "UgzXbzLVxBnQ4fjwtmF4AaABAg", "text": "How has it been with so many cars and shopping plazas nearby? Or do you have pretty low noise and this place is sort of insulated from that?", "author": "@adamc.7795", "like_count": 0, "published_at": "2022-03-05T20:53:53Z", "parent_id": null, "video_id": "aDaS_v-SkNQ"}, {"id": "UgzXbzLVxBnQ4fjwtmF4AaABAg.9ZCcd3esIpO9ZCdz_YMrUg", "text": "Depends on if your unit is on the main road. If it was like mine you will hear noise for sure. I would pick a inside facing unit.", "author": "@JohnnyKReviews", "like_count": 1, "published_at": "2022-03-05T21:05:42Z", "parent_id": "UgzXbzLVxBnQ4fjwtmF4AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "UgzXbzLVxBnQ4fjwtmF4AaABAg.9ZCcd3esIpO9ZNrXFxBdWq", "text": "@JohnnyKReviews IF only they charged less for those units right? Due to external factors affecting quality of life.", "author": "@adamc.7795", "like_count": 1, "published_at": "2022-03-10T05:35:41Z", "parent_id": "UgzXbzLVxBnQ4fjwtmF4AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "UgzXbzLVxBnQ4fjwtmF4AaABAg.9ZCcd3esIpO9ZNs6lyQ7SD", "text": "@adamc.7795 problem is supply and demand. And demand way exceeds the supply unfortunately. Due to the pandemic people also decided to sell their homes and move into apartments. Just a bad combination all around", "author": "@JohnnyKReviews", "like_count": 0, "published_at": "2022-03-10T05:40:48Z", "parent_id": "UgzXbzLVxBnQ4fjwtmF4AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "UgzXbzLVxBnQ4fjwtmF4AaABAg.9ZCcd3esIpO9ZPEJociqJu", "text": "@JohnnyKReviews Hopefully the market will catch up and become realistic because there''s definitely more people leaving CA and going further outside the cities if they decided to stay here. Yeah it sounds like 2008, selling and then renting due to no other choice or to take advantage of the high prices.", "author": "@adamc.7795", "like_count": 1, "published_at": "2022-03-10T18:22:48Z", "parent_id": "UgzXbzLVxBnQ4fjwtmF4AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "UgzXbzLVxBnQ4fjwtmF4AaABAg.9ZCcd3esIpO9ZPHyFrMIYI", "text": "@adamc.7795 I hope so too, but from what I know and seen, no market crash anytime soon. Inflation is driving everything up, and loans aren\u2019t provided like water from back in the day, much more stringent. Certain pockets of California due to demand and low supply, prices unfortunately won\u2019t go down. Sure a lot of people moving from California to Texas and Florida, but California had some dumb laws preventing building of new construction. Thus low supply and high demands", "author": "@JohnnyKReviews", "like_count": 0, "published_at": "2022-03-10T18:54:40Z", "parent_id": "UgzXbzLVxBnQ4fjwtmF4AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "UgxFvJlPwzvdn0v9Ff54AaABAg", "text": "Are you able to get video footage of Plan S, which is Amalfi largest 2 bedroom unit? They have virtual tours for every unit except that one which I''M interested in. Thanks for the great detailed review of the property!", "author": "@sebastianwinterfell", "like_count": 1, "published_at": "2021-11-18T05:54:02Z", "parent_id": null, "video_id": "aDaS_v-SkNQ"}, {"id": "UgxFvJlPwzvdn0v9Ff54AaABAg.9UsVae5khUz9UsW0BhoLPH", "text": "Hi Sebastian I have not but will see if there are any units available on that Plan S to review. Feel free to subscribe to the channel with notification bell so you\u2019re notified when I do post. Thanks", "author": "@JohnnyKReviews", "like_count": 0, "published_at": "2021-11-18T05:57:39Z", "parent_id": "UgxFvJlPwzvdn0v9Ff54AaABAg", "video_id": "aDaS_v-SkNQ"}, {"id": "Ugwlr4My4cvpfEYcyyF4AaABAg", "text": "That sounds about right or a little less...you can afford a 1 bed room high rise. Older 2 bd condos 900k to start. Great Park just Mello and HOA set you back 1400 to -1600 per month ...Any house in OC decent safe starts at 1.1mm", "author": "@sallycoo5527", "like_count": 0, "published_at": "2026-02-09T04:08:50Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "Ugzyc_zneQ_H7l8GZsd4AaABAg", "text": "I live down the street and yes most apartment homes are over a million", "author": "@dg8676", "like_count": 1, "published_at": "2026-01-02T15:30:23Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "UgyXzoaz9Ie2z9d7WVd4AaABAg", "text": "I grew up in Irvine and still live here. With that statistic you just said I would say the majority of people that live here now are considered low income. They have built so many more apartments here now.", "author": "@wali82", "like_count": 0, "published_at": "2025-12-24T16:09:09Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "UgzXttZ4Tz_S4mML3-N4AaABAg", "text": "That\u2019s fair, suspicious and interesting at the same time.", "author": "@ashleymoore_12_99", "like_count": 0, "published_at": "2025-11-10T22:49:38Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "UgwHUXQjrjb23ztHH2R4AaABAg", "text": "And also extremely boring and cookie cutter homes.", "author": "@alfonsonuno", "like_count": 0, "published_at": "2025-09-15T00:23:49Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "Ugwcqo5nsoQK9kXD06h4AaABAg", "text": "Quote the source ?", "author": "@Gary-v7j", "like_count": 0, "published_at": "2025-09-07T18:48:26Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "UgzY-nqUFf_L5mV9LX54AaABAg", "text": "I\u2019m a cyber hacker and stole 1.7 million in 2022 and have made money along the way Irvine is rich and very nice to live if you got money", "author": "@booogiee1258", "like_count": 1, "published_at": "2025-06-22T20:36:29Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "UgzY-nqUFf_L5mV9LX54AaABAg.AJgNWuK3SaYAOBpC42KwgU", "text": "Right\u2026.", "author": "@alexc08", "like_count": 0, "published_at": "2025-10-12T21:08:19Z", "parent_id": "UgzY-nqUFf_L5mV9LX54AaABAg", "video_id": "IFri3Ejn7AM"}, {"id": "UgzswKRhCYpoHsfExCp4AaABAg", "text": "Is this pre or post tax?", "author": "@laurencharltonn", "like_count": 0, "published_at": "2025-05-17T16:41:08Z", "parent_id": null, "video_id": "IFri3Ejn7AM"}, {"id": "UgzswKRhCYpoHsfExCp4AaABAg.AIEFyj23TKAAOvvk_QzLdC", "text": "Pre tax", "author": "@pseller4052", "like_count": 0, "published_at": "2025-10-31T04:09:54Z", "parent_id": "UgzswKRhCYpoHsfExCp4AaABAg", "video_id": "IFri3Ejn7AM"}, {"id": "Ugx--GOw_QyVQ560E314AaABAg", "text": "8:20 assigned and 8:38 very difficult for someone to drive in and use grill. street parking are for guests and you have to have a pass on your car bc they monitor CONSTANTLY, meaning no time trying to drive in and use the grill", "author": "@rockyrodes5", "like_count": 0, "published_at": "2026-02-11T23:26:39Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "Ugx--GOw_QyVQ560E314AaABAg.AT6D-vsTHzJATBece6kABl", "text": "Really???? They told us that we don\u2019t even need to register overnight guests \ud83d\ude02\ud83d\ude02\ud83d\ude02", "author": "@theamericanexplorer", "like_count": 0, "published_at": "2026-02-14T02:12:56Z", "parent_id": "Ugx--GOw_QyVQ560E314AaABAg", "video_id": "srt2NuMUmpk"}, {"id": "Ugx_SBkM3eJCHRl0F2l4AaABAg", "text": "Don\u2019t do it find another place another state", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:17:28Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgzskPqRyemqVIE5NnR4AaABAg", "text": "Welcome to California. Welcome to Orange County the Irvine development company building huge compounds to shuffling people. That is their goal. Heavy taxes have a government and you will get nothing.", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:12:24Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgwBv8B2eGpjpqi2XNt4AaABAg", "text": "Just one big heaping mound of regret why would you don\u2019t do it?", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:10:58Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgwwmASSGpLUE9uHz2Z4AaABAg", "text": "I hope you love taxes and heavy government. Enjoy", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:06:56Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgyCf_tuMyymtLshQjl4AaABAg", "text": "Why would you buy a property in California?\ud83d\ude02 What an absolute joke", "author": "@johnhyland3084", "like_count": 0, "published_at": "2025-11-08T04:06:30Z", "parent_id": null, "video_id": "srt2NuMUmpk"}, {"id": "UgyCf_tuMyymtLshQjl4AaABAg.APFWigIS6dNAT6DJ1Qk3oR", "text": "irvine company doesn''t do condos. these are all rentals.", "author": "@rockyrodes5", "like_count": 0, "published_at": "2026-02-11T23:29:15Z", "parent_id": "UgyCf_tuMyymtLshQjl4AaABAg", "video_id": "srt2NuMUmpk"}, {"id": "Ugw6UZCj9CyxpiJ6ew94AaABAg", "text": "\ud83e\udd14Thinking of moving to or selling your home in Irvine California?\ud83c\udf34\r\n\ud83d\udcf1Call or text:  949-285-1207\r\n\ud83d\udce7Email:  info@livinginirvinecalifornia.com\r\n\ud83d\udcc5Zoom:  http://bit.ly/3ZeNnEa\r\n Full Channel: \ud83d\udc49\ud83d\udc49\ud83d\udc49: https://bit.ly/3NXecX3\r\n=======", "author": "@LivinginIrvineCalifornia", "like_count": 0, "published_at": "2023-01-20T02:19:27Z", "parent_id": null, "video_id": 