INSERT INTO community_metrics (community_id, updated_at, median_rent, rent_2b2b, rent_1b1b, avg_sqft, grocery_density_per_km2, crime_rate_per_100k, rent_trend_12m_pct, night_activity_index, noise_avg_db, noise_p90_db, youtube_video_ids, youtube_comments, overall_confidence, details_json) VALUES ('university-town-center', '2026-02-25 02:57:19.067908', NULL, NULL, NULL, NULL, 1.326, NULL, NULL, 0.0, NULL, NULL, '["wyJp732XSXo", "3lep-Ui5FxE", "hE3oP-bG3as", "Nz2VCPxuVes", "-H1L4lrwlso", "LJv2BkHnpU0", "NitCpMg3RTE", "kOOtA8Snjx0"]', '[{"id": "UgyEyfyhLeW-B6yJGv54AaABAg", "text": "What''s the sound used on this video pls?", "author": "@osinowopaul9419", "like_count": 0, "published_at": "2025-07-06T19:38:05Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgyQ7k8blaALxTShaE94AaABAg", "text": "I  was a freshman there  in 1981. My last class there was in 1992. This is mostly unrecognizable!", "author": "@wehosrmthink7510", "like_count": 0, "published_at": "2024-05-16T09:40:18Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgyvF5OqGEfvcq6PF4J4AaABAg", "text": "I got accepted today and I\u2019m so skeptical, any help guys? \ud83d\ude2d", "author": "@liamcarrington7681", "like_count": 4, "published_at": "2024-03-11T06:46:10Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgyvF5OqGEfvcq6PF4J4AaABAg.A0ppTu-7rBfA2bSLuU75ZY", "text": "I think cafeteria area is not the best choice for food\ud83d\ude05 and if you are using public transportation, the bus comes every hour and parking situation is a bit rough. Hopefully, you would survive!\ud83d\udc4d", "author": "@kyuseonyum3049", "like_count": 0, "published_at": "2024-04-24T09:48:46Z", "parent_id": "UgyvF5OqGEfvcq6PF4J4AaABAg", "video_id": "wyJp732XSXo"}, {"id": "UgxJEpihFAbZK4A2wDh4AaABAg", "text": "is UCI different  UC Berkeley or not", "author": "@MinhD\u01b0\u01a1ng-n8x", "like_count": 0, "published_at": "2023-12-24T03:22:37Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgwEOsDLxXSMSqnDO6B4AaABAg", "text": "Talk to student services for student discounts", "author": "@angelachanellehuang5663", "like_count": 0, "published_at": "2023-09-24T04:05:08Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "Ugz2XNmRjPsBrSwKfRh4AaABAg", "text": "Thank you, it\u2019s a really helpful video", "author": "@kyzuno5066", "like_count": 1, "published_at": "2022-10-04T23:18:13Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgwJjCmokY0tQ3ZH7J54AaABAg", "text": "just accepted to the drama program!", "author": "@dreadpersephone", "like_count": 0, "published_at": "2022-04-16T16:20:17Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgxGwJrIFP88aYywXhx4AaABAg", "text": "Just got in \ud83d\ude2d waiting on the other UCs but I\u2019m loving the campus so far", "author": "@MilkyWay-gi8km", "like_count": 7, "published_at": "2022-04-16T04:48:18Z", "parent_id": null, "video_id": "wyJp732XSXo"}, {"id": "UgxGwJrIFP88aYywXhx4AaABAg.9_s2WfxgNCX9aBHBbazMw8", "text": "were you waitlisted?", "author": "@xs_4689", "like_count": 0, "published_at": "2022-04-24T01:21:19Z", "parent_id": "UgxGwJrIFP88aYywXhx4AaABAg", "video_id": "wyJp732XSXo"}, {"id": "UgxGwJrIFP88aYywXhx4AaABAg.9_s2WfxgNCX9bDpZTUkFoI", "text": "@xs_4689 no I got into all of them and I committed to UCLA!!", "author": "@MilkyWay-gi8km", "like_count": 0, "published_at": "2022-05-19T21:40:17Z", "parent_id": "UgxGwJrIFP88aYywXhx4AaABAg", "video_id": "wyJp732XSXo"}, {"id": "UgxGwJrIFP88aYywXhx4AaABAg.9_s2WfxgNCX9fdY1AVDt7_", "text": "@MilkyWay-gi8km omg what were ur stats pls I need help am really stressing", "author": "@anthoniadebola1144", "like_count": 0, "published_at": "2022-09-06T16:43:23Z", "parent_id": "UgxGwJrIFP88aYywXhx4AaABAg", "video_id": "wyJp732XSXo"}, {"id": "Ugy-BjL9VuIZOWwUEl14AaABAg", "text": "\u7559\u5b66\u751f\u306fArroyo Vista\u304c\u5927\u534a\u3068\u805e\u304d\u307e\u3057\u305f\u3002\u305d\u3053\u4ee5\u5916\u306e\u5bee\u306b\u7559\u5b66\u751f\u306f\u4f4f\u3093\u3067\u3044\u307e\u3059\u304b\uff1f\u307e\u305f\u3001\u4ed6\u306e\u5bee\u3060\u3068\u7559\u5b66\u751f\u304c\u5c11\u306a\u304f\u3066\u8f9b\u3044\u601d\u3044\u3092\u3059\u308b\u3053\u3068\u306f\u3042\u308a\u307e\u3059\u304b\uff1f", "author": "@\u305f\u3053-r9x1q", "like_count": 0, "published_at": "2024-07-28T16:34:54Z", "parent_id": null, "video_id": "-H1L4lrwlso"}, {"id": "Ugwgx2WHOSrfo0MT0N94AaABAg", "text": "Camino Del Sol is the safer place to live? :-/   Why isn''t the other place safe too?", "author": "@lisan1823", "like_count": 0, "published_at": "2023-09-21T06:03:49Z", "parent_id": null, "video_id": "-H1L4lrwlso"}, {"id": "Ugwgx2WHOSrfo0MT0N94AaABAg.9uuruM-AYdh9uwFVrcJXPm", "text": "Hi there, Irvine is generally pretty safe! Camino Del Sol is a smaller community and is closer to campus/other housing than Vista Del Campo and Vista Del Campo Norte, so there is more traffic and events happening regularly. Vista Del Campo is on the outskirts of campus so there is minimal traffic/activity happening in that area but some of my friends who lived in that area enjoyed it. What was sometimes challenging was how far it was from campus.", "author": "@a2fIrvine", "like_count": 2, "published_at": "2023-09-21T18:58:02Z", "parent_id": "Ugwgx2WHOSrfo0MT0N94AaABAg", "video_id": "-H1L4lrwlso"}, {"id": "Ugwlj3KmqBbSiogrvXh4AaABAg", "text": "I actually live near here and go to uni high school I walk around up I from time to time near the Main Street so I know the area pretty well", "author": "@strangerthingsfan4521", "like_count": 0, "published_at": "2022-05-24T02:29:51Z", "parent_id": null, "video_id": "-H1L4lrwlso"}, {"id": "Ugy-3Enzl44diTnMgBh4AaABAg", "text": "I\u2019m not sure if you guys answer anymore but in terms of cost do you guys recommend ACC or UTC? I\u2019m going to be a transfer soon and this whole housing process have been giving me headaches. Also do any of the options allow non-students to temporarily live with you for a while like for a visit?", "author": "@user-kx1cy3re6k", "like_count": 3, "published_at": "2022-05-20T14:23:34Z", "parent_id": null, "video_id": "-H1L4lrwlso"}, {"id": "Ugy-3Enzl44diTnMgBh4AaABAg.9bFcNn0SyB79bFcfE9gMuK", "text": "Also do I have to have a roommate or is there options otherwise?", "author": "@user-kx1cy3re6k", "like_count": 1, "published_at": "2022-05-20T14:26:05Z", "parent_id": "Ugy-3Enzl44diTnMgBh4AaABAg", "video_id": "-H1L4lrwlso"}, {"id": "UgxjJwZyUU_4VNxY5vF4AaABAg", "text": "Hi , I am Namgyal and lives in New York , this summer I got accepted into a research program at UCI and I am looking for a room for a 10 weeks . So any leads on such will be highly appreciated. Thank you", "author": "@namgyaldolma2098", "like_count": 0, "published_at": "2022-03-31T12:58:01Z", "parent_id": null, "video_id": "-H1L4lrwlso"}, {"id": "UgxjJwZyUU_4VNxY5vF4AaABAg.9_EiqQreOsG9asZnwV-har", "text": "One pointer is the people subleasing their rooms for summer, for the ACC apartments, since the lease is 12 months long and not everyone is staying for the summer. Another pointer would be summer housing at the various on-campus housing communities, including dorms, though I''m not sure on the specifics", "author": "@_DeathDreams_", "like_count": 0, "published_at": "2022-05-11T06:10:33Z", "parent_id": "UgxjJwZyUU_4VNxY5vF4AaABAg", "video_id": "-H1L4lrwlso"}, {"id": "UgxRKb6iTwavcDuRqCR4AaABAg", "text": "Very good and funny videos bring a great sense of entertainment!", "author": "@PhuongNguyen-se7xd", "like_count": 0, "published_at": "2021-10-25T08:49:11Z", "parent_id": null, "video_id": "-H1L4lrwlso"}, {"id": "UgyGVkU9iMq3hM_ZBLN4AaABAg", "text": "Most nicest?!?!?!? No!! No!!! Noooooooooo. Lol", "author": "@ellenlewitt", "like_count": 0, "published_at": "2021-08-12T22:07:49Z", "parent_id": null, "video_id": "-H1L4lrwlso"}]', 0.33, '{"sources": {"zori_csv": false, "overpass_grocery": true, "overpass_night_activity": false, "overpass_noise": false, "irvine_crime": false, "irvine_crime_source": "missing:missing_api_key", "crime_api": fal