, "video_id": "jdypSV-kTD8"}, {"id": "UgxqkYXuoD9zXvfX3jl4AaABAg", "text": "Brief back story guys:\nI asked the guy why he isnt wearing a mask when the female officer Jennifer said to all of us in the waiting room were required to wear it and gave us problems. There buddy there wasnt wearing one and yelled at me when I asked why he isnt wearing one and if I had a problem with it which I said I did,  since everyone else there had to wear one. But as usual the tyrants backed up their buddy who was there to get a CCW and didnt make him wear one when all the rest of us did, hence why I took mine off at the end. Typical Costa Mesa corruption, Thanks for the upload Phil! You\u2019re the best!", "author": "@newportninja245", "like_count": 7, "published_at": "2021-09-29T20:28:04Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgzgcAcocNJWtZ_0Hy54AaABAg", "text": "Marathon Watching 4/19/23 Seriously?! Really NNC?! \ud83d\ude2e\ud83d\ude2e\u2764\u2764", "author": "@edwardmajka3144", "like_count": 1, "published_at": "2023-04-19T22:14:02Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "Ugz98GCiwJ40SU1gr0l4AaABAg", "text": "Wow I was pulled over by 10-Newport beach pigs and 2-Costa Mesa jerk offs no joke  for no front License plate three weeks ago and none was wearing a mask. But when I reached into my glove compartment for my registration I had a gun to my head. Pigs", "author": "@rickapodaca6999", "like_count": 0, "published_at": "2021-10-02T00:13:08Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgwgWypTHOkD_lwMEIx4AaABAg", "text": "This was filmed with a potato", "author": "@krishelfferich3487", "like_count": 1, "published_at": "2021-10-01T02:13:10Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgzBEjrTRv4RhCiKrg94AaABAg", "text": "\ud83d\udc4d\ud83d\ude0e", "author": "@waltk9067", "like_count": 1, "published_at": "2021-09-30T00:38:33Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgyrJ7OJ2veHKTGdYUZ4AaABAg", "text": "Polly Audis just arrested a Sheriff for doing this.", "author": "@XBootlicker", "like_count": 2, "published_at": "2021-09-29T19:48:46Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgwoY-zU0CjElA5rPrF4AaABAg", "text": "\ud83d\ude06\ud83d\ude01\ud83d\ude05 \ud83d\udcaf\ud83d\udcaf\ud83d\udc4d", "author": "@tommywood9221", "like_count": 1, "published_at": "2021-09-29T19:38:33Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgwvXpo8B4Gl_cxVp-F4AaABAg", "text": "\u270c\ufe0f\ud83d\ude0e\ud83d\udcf7\ud83d\udcaf", "author": "@xjackiex24", "like_count": 3, "published_at": "2021-09-29T19:36:10Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgwSjR1gY65ljrcq0_14AaABAg", "text": "\"He refused the order to mask up so I yelled don''t reach for my gun!\" \n\nI''m sure it''s probably happened.", "author": "@christophwilhelm6431", "like_count": 4, "published_at": "2021-09-29T19:26:21Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "Ugx9c03vgvsI4P9XvZ14AaABAg", "text": "\ud83c\udfa3\ud83c\udfa3\ud83c\udfa3\ud83c\udfa3\u2764\u2764 truckers the backbone of America", "author": "@archieletsyouknow5508", "like_count": 3, "published_at": "2021-09-29T19:26:04Z", "parent_id": null, "video_id": "ddxrI00r-XA"}, {"id": "UgzCF8-88t_J6dpzfUV4AaABAg", "text": "Cross at 1am. No wait", "author": "@aheazzy28", "like_count": 0, "published_at": "2026-02-23T12:23:34Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "Ugysxh56dByWnZjJaLh4AaABAg", "text": "If you work in the morning, I''d suggest going across at around 3 am.  Once you get across to San Diego, pull over and park and take a nap until work.  I knew a guy I worked with that dud this.  He started his shift at 6am.  He would cross at around 3am, then park and take a nap for 2.5 hours until work time.", "author": "@dzim8822", "like_count": 0, "published_at": "2025-12-21T04:36:35Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "Ugzgt6TDqMRP6HVjz7F4AaABAg", "text": "A couple days ago I tried to travel into Mexico at the Tijuana border at San ysidro my vehicle has papers from the DMV saying that it''s temporary registered until the end of October and they denied my entry then then I tried to go across Otay Mesa 2 days ago and they accepted my paperwork for my car but said I had too many dogs I am traveling with I''m traveling with my boyfriend and are six dogs my mom is ill and I need to get to Puerto Vallarta as soon as possible what can I do and who can help me", "author": "@MyomiHammond-r6n7p", "like_count": 0, "published_at": "2025-09-15T20:09:46Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "Ugzgt6TDqMRP6HVjz7F4AaABAg.AN6C1d4XhuLAQzIeZWP8HO", "text": "Take the dogs to a dog sitter.", "author": "@dzim8822", "like_count": 0, "published_at": "2025-12-21T04:39:18Z", "parent_id": "Ugzgt6TDqMRP6HVjz7F4AaABAg", "video_id": "sqyWPTtkeV8"}, {"id": "UgwsEs1Yztu9qAJgWmd4AaABAg", "text": "I believe the best time is to cross at night. Basically, there is no line at the time.", "author": "@rickkytikkitavi2898", "like_count": 4, "published_at": "2025-06-03T15:37:33Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "UgyCjyeBu9ise746fYd4AaABAg", "text": "I need friends to hang out with, you Fart head.", "author": "@micahspeacefullife4203", "like_count": 0, "published_at": "2025-02-28T13:17:24Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "Ugy0Y4ME9fIpq09cn1l4AaABAg", "text": "she''s a hottie", "author": "@deathfall999", "like_count": 0, "published_at": "2025-02-21T17:51:35Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "UgxFhqDoTN2UJs6lR4F4AaABAg", "text": "Girl had to spend.2 hours at the parlor to get her hair and make up done to make this short video \ud83d\ude01", "author": "@ramj.mercado7957", "like_count": 3, "published_at": "2025-02-06T00:45:26Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "UgxFhqDoTN2UJs6lR4F4AaABAg.AEB36LZKXVKATPHInNJ4NR", "text": "\ud83d\ude02\ud83d\ude02\ud83d\ude02\ud83d\ude02 yah..... 3pm ishh \ud83d\ude05\ud83d\ude05\ud83d\ude05", "author": "@Zitagirl76", "like_count": 0, "published_at": "2026-02-19T09:09:44Z", "parent_id": "UgxFhqDoTN2UJs6lR4F4AaABAg", "video_id": "sqyWPTtkeV8"}, {"id": "UgwqT1a3hBfFx3NvrJp4AaABAg", "text": "Hi Jamie, I''m Mike. I live here in San Diego and wanted to know if you and I can have a get together at some point. like you and I can go out somewhere as friends!?\ud83d\ude4f\ud83c\udffc", "author": "@micahspeacefullife4203", "like_count": 1, "published_at": "2025-01-20T02:25:20Z", "parent_id": null, "video_id": "sqyWPTtkeV8"}, {"id": "Ugw-BjMjLwsWfhSwaaN4AaABAg", "text": "Have You Heard Of South Coast Plaza Because This Store In Close To SCP And It Is The Largest Mall On The West Coast", "author": "@jvargas6034", "like_count": 1, "published_at": "2023-10-09T14:12:37Z", "parent_id": null, "video_id": "IIvandbEzBw"}, {"id": "Ugzm3rrn2CV9mdJlXX54AaABAg", "text": "We have to go there, Mr. E! It''s close to Los Angeles/Glendale...all that area! 1 hr flight...", "author": "@vivianabarnwell", "like_count": 0, "published_at": "2023-10-06T00:01:35Z", "parent_id": null, "video_id": "IIvandbEzBw"}, {"id": "Ugzm3rrn2CV9mdJlXX54AaABAg.9vVqNH3axQy9vVvgZIH4sc", "text": "alright", "author": "@Evanlovestarget2026", "like_count": 0, "published_at": "2023-10-06T00:48:02Z", "parent_id": "Ugzm3rrn2CV9mdJlXX54AaABAg", "video_id": "IIvandbEzBw"}, {"id": "UgzElq5mER6dAWnzYW14AaABAg", "text": "Let me guess you\u2019ve passed this location before?", "author": "@Asher10-Abandoned-Buildings", "like_count": 1, "published_at": "2023-10-05T23:11:58Z", "parent_id": null, "video_id": "IIvandbEzBw"}, {"id": "UgzElq5mER6dAWnzYW14AaABAg.9vVkgxBN88v9vVvXJUu7d7", "text": "No", "author": "@Evanlovestarget2026", "like_count": 0, "published_at": "2023-10-06T00:46:38Z", "parent_id": "UgzElq5mER6dAWnzYW14AaABAg", "video_id": "IIvandbEzBw"}, {"id": "UgzElq5mER6dAWnzYW14AaABAg.9vVkgxBN88v9vXJODt-yPb", "text": "I\u2019m San Jose California and never been to Costa Mesa california", "author": "@Evanlovestarget2026", "like_count": 0, "published_at": "2023-10-06T13:43:05Z", "parent_id": "UgzElq5mER6dAWnzYW14AaABAg", "video_id": "IIvandbEzBw"}, {"id": "UgzElq5mER6dAWnzYW14AaABAg.9vVkgxBN88v9vXlnfo_6o4", "text": "@Evanlovestarget2026 oh ok well good vid!", "author": "@Asher10-Abandoned-Buildings", "like_count": 0, "published_at": "2023-10-06T18:00:06Z", "parent_id": "UgzElq5mER6dAWnzYW14AaABAg", "video_id": "IIvandbEzBw"}, {"id": "Ugw_k0DZaqaTjgPs7vJ4AaABAg", "text": "None of these guys are DEA, they are all Orange County Sheriffs Narcotics detectives or possibly even SIU detectives. Either way they are with the OCSD and obviously had been doing surveillance on this couple for at least that day if not weeks. It''s really not cool to publish images of people who risk their lives while working undercover to protect us.", "author": "@patricksmith2553", "like_count": 1, "published_at": "2019-05-03T07:45:43Z", "parent_id": null, "video_id": "1Li6hgwtF-M"}, {"id": "Ugxq0nvhV951PP8t_6t4AaABAg", "text": "Yesterday, Glimmerito tried to shoot a 30-year-old woman \ud83d\udc69 after trying to replace my music \ud83c\udfb6 therapist after I attacked and nearly put an end to her.", "author": "@emily91303", "like_count": 0, "published_at": "2023-08-03T09:19:09Z", "parent_id": null, "video_id": "9jdBAgf77nw"}, {"id": "UgzVSt4kU9HLIexEAM94AaABAg", "text": "If you wouldnt of broke the law coming here illegally in the first place you wouldnt be dead. \ud83d\ude02\ud83d\ude02\ud83d\ude02\ud83d\ude02.. try and play victim.", "author": "@travisengland1368", "like_count": 0, "published_at": "2023-07-17T00:46:45Z", "parent_id": null, "video_id": "9jdBAgf77nw"}, {"id": "Ugw_t3DfLVwLJKBV5SN4AaABAg", "text": "Well maybe if they didnt hit a car with a family in it and then drive away they wouldnt of got shot.. good job lee. You da man Stay up g..", "author": "@travisengland1368", "like_count": 0, "published_at": "2023-07-17T00:45:04Z", "parent_id": null, "video_id"