een men and they are wiping her mind.", "author": "@BMoney77", "like_count": 0, "published_at": "2023-08-24T12:37:00Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "UgxOvQNkhY9oAN2SQnJ4AaABAg", "text": "I thought DUI checkpoints were illegal.", "author": "@BMoney77", "like_count": 2, "published_at": "2023-08-24T12:34:46Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "UgxHY75iFGSpLjUtZ-l4AaABAg", "text": "Technically speaking, checkpoints lack RAS to justify the stop. Without RAS, no alcohol testing is legitimate because the entire detention does not have any legitimacy. \n\nSo even breath and blood tests have no legal merit and are fully voluntary, in this situation.", "author": "@shushnik", "like_count": 1, "published_at": "2023-07-13T12:54:19Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "Ugy4lfavtD4BLvATeX94AaABAg", "text": "what a total waist of money and resources, all those cops and MOST of them just standing around drawing overtime pay for very little results, but they think they are doing the community a good thin, when it is only pissing people off in the community", "author": "@jameswilliams5175", "like_count": 1, "published_at": "2023-07-01T13:21:06Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "UgyvZylysS6MmRGG4ZJ4AaABAg", "text": "Look at these stupid cops all laughing and having a good time picking a choosing who they gonna arrest even though there sober. They don\u2019t care as long as they meet there quota and make a arrest. They\u2019ll just have the courts deal with it afterwards even if it\u2019s get thrown out it\u2019s still a burden and hassle waisting a whole day of work just to go to court for being sober. Go to hell cops get a real job you unskilled civil servant", "author": "@flipminerchino370", "like_count": 1, "published_at": "2023-06-17T21:40:10Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "UgyFg1wr220JVO1CRBZ4AaABAg", "text": "On performance test not being required. If the driver pays attention the cop usually asks \"would you mind or do you mind doing some performance test?\"\nThey don''t demand it or say \"NOW you''re  going to.....\"", "author": "@montewall5813", "like_count": 0, "published_at": "2023-06-16T12:04:04Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "Ugwun_fMom0nT46VvNR4AaABAg", "text": "What a waste of resources.  There must be 30 cops or more.  Are they expecting a MAGA drive through mob or something?  Sheesh.", "author": "@MrNucEngineer", "like_count": 1, "published_at": "2023-06-10T04:24:25Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "UgwMSZ9fQJfnPQmSBu54AaABAg", "text": "Why do this stupid old fieldsobrietytest it takes a lot of time .for gods sake just take a blowtest on your poor victims!!!", "author": "@Sunkan111", "like_count": 0, "published_at": "2023-06-02T13:10:36Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "Ugxmxt7O134WmWA8R0p4AaABAg", "text": "You''re a tool", "author": "@lucasmoore8801", "like_count": 0, "published_at": "2023-06-01T07:26:39Z", "parent_id": null, "video_id": "feisQPoALLU"}, {"id": "UgyFDu3Sx_whXcStrgl4AaABAg", "text": "\ud83d\udc99\ud83e\udd69", "author": "@Acquisition1913", "like_count": 0, "published_at": "2026-02-16T13:55:16Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "Ugx4HCBeHvpUea297op4AaABAg", "text": "Very useful, thank you.", "author": "@RibbitResist", "like_count": 0, "published_at": "2026-02-14T20:55:54Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "UgwR9JN1nBq-sJaSA7p4AaABAg", "text": "Go to Panama and visit us too.", "author": "@reneesanchezmiranda8588", "like_count": 0, "published_at": "2026-02-08T21:26:18Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "UgyEn8Lk0798DSvtTLh4AaABAg", "text": "couldnt live without the white sneaker tip. wow", "author": "@Stormy_Rae_Taylor", "like_count": 0, "published_at": "2026-02-07T05:05:58Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "Ugy7ZIbXx1koPY2i2TV4AaABAg", "text": "It''s expensive probably bc you are living like a tourist.", "author": "@mayc8674", "like_count": 0, "published_at": "2026-02-03T15:01:17Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "UgwNgWfwN8PVc8cZKNB4AaABAg", "text": "Hi! I''m from CR and I understand San Jos\u00e9 is not the prettiest city in the world. It def has a lot of challenges to put it lightly. But there''s neighborhoods like Rohrmoser, Escalante and you didn''t even go to Escaz\u00fa. There''s so many cute coffee shops in the capital that you missed out on.", "author": "@georgiflores9949", "like_count": 0, "published_at": "2026-01-23T07:49:03Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "UgzBYmo08NcCd2A_sGZ4AaABAg", "text": "If it too expensive why go there?", "author": "@theverdict4322", "like_count": 0, "published_at": "2026-01-20T07:58:34Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "Ugw4Yjlij6AenfMg2cl4AaABAg", "text": "Which month did you travel to Costa Rica?", "author": "@she2302", "like_count": 0, "published_at": "2026-01-15T11:53:09Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "UgxBaGnBHLRcE3QuBGB4AaABAg", "text": "Not to hate, but I\u2019m from costa rica and I get very sad when someone says not to spend time on San Jose and instead going to place that many cr people can\u2019t afford or just get discriminated there.", "author": "@Shukokantoru", "like_count": 0, "published_at": "2025-12-29T08:51:37Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "UgwIPfc7dYKbwJr2Jnx4AaABAg", "text": "Guys, i went to costa rica last year, and i\u2019m going again tomorrow. If u like tea, just be warned, they do NOT have tea. Starbucks mayyyy have some, but most places DON\u2019T. This year, my family is taking tea bags for our week in cr. Just be warned if u like tea! \u2764", "author": "@georgiasrobloxacc", "like_count": 1, "published_at": "2025-12-25T16:30:27Z", "parent_id": null, "video_id": "1943IyY2jug"}, {"id": "Ugy5R2HFoW8z-qC4pv54AaABAg", "text": "43k a month! Lmfao! We are all screwed! You mean 4,300 a month. Still crazy!", "author": "@chercuts", "like_count": 0, "published_at": "2026-02-23T14:16:14Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "UgzU-VuLGtIXl5vfX0B4AaABAg", "text": "I lived in one but you neglected to say that normally you share the room with a roommate", "author": "@Happytobalive", "like_count": 0, "published_at": "2026-02-17T23:06:28Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "Ugxfa5V2cy4bYIJycCh4AaABAg", "text": "$43,000 a month. I can live at home with 24/7 nurses for less. What a travesty.", "author": "@Crymeariver227", "like_count": 0, "published_at": "2026-02-17T00:30:07Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "Ugx-MmpRZwryphJN8xB4AaABAg", "text": "Where did you learn your math skills $43.000/month doesn''t equal over $50.000/year!!", "author": "@elkeboos2415", "like_count": 0, "published_at": "2026-02-14T21:55:28Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "UgwbUM211hS22rBFF7V4AaABAg", "text": "At $43,000 a month Thats well over $51,000 a year\ud83d\ude02", "author": "@ImmaTwoPops", "like_count": 0, "published_at": "2026-02-14T01:07:58Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "Ugyu-HTv2Sf39G8yZLN4AaABAg", "text": "That sounds like she meant 4,300.00 a month, not 43,000. And yes, on the low end you can expect to pay 50-60k a year. Many places are now 9-10k a month. So, 100-120k a year. And that\u2019s before the extras.", "author": "@trishalamb138", "like_count": 0, "published_at": "2026-02-11T04:20:58Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "Ugxc6xXy6sLTfXOFDAN4AaABAg", "text": "Well I visited two upon being told it was strongly recommended my grandma go to one rather than come home. Both had dementia patients in wheel chairs just stuck in the halls and corners. It was sad", "author": "@broken_clock_right_twice", "like_count": 0, "published_at": "2026-02-08T02:14:01Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "UgwjPhw10dZQOF0OhSB4AaABAg", "text": "$43k a month is WAY MORE than $51k/year. Check your math.", "author": "@JaCoCop", "like_count": 0, "published_at": "2026-02-07T22:23:07Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "Ugzt-zXAJCBn07XdK454AaABAg", "text": "My husband was looking forward to moving to assisted living without me. By all means.", "author": "@rominagresely526", "like_count": 0, "published_at": "2026-02-07T18:50:47Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}, {"id": "UgzSN0aahEfFDHdvusF4AaABAg", "text": "$43,000 per month, $53,000 per year?", "author": "@AugustStar-h3z", "like_count": 0, "published_at": "2026-02-07T00:25:27Z", "parent_id": null, "video_id": "6C8M4QtFrBU"}]', 0.33, '{"sources": {"zori_csv": false, "overpass_grocery": true, "overpass_night_activity": false, "overpass_noise": false, "irvine_crime": false, "irvine_crime_source": "missing:missing_api_key", "crime_api": false, "crime_api_source": "missing:missing_api_key", "youtube_video": true, "commute_minutes": null, "viirs_night_activity": false, "night_activity_source": "default"}}');
