INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text, parent_id, author_name, like_count) VALUES ('5024f87c-9d4b-4cc2-b2d4-77e1ad287c46', 'woodbridge', 'youtube', 'UgzXbzLVxBnQ4fjwtmF4AaABAg.9ZCcd3esIpO9ZPHyFrMIYI', NULL, '2022-03-10 18:54:40', NULL, '@adamc.7795 I hope so too, but from what I know and seen, no market crash anytime soon. Inflation is driving everything up, and loans arent provided like water from back in the day, much more stringent. Certain pockets of California due to demand and low supply, prices unfortunately wont go down. Sure a lot of people moving from California to Texas and Florida, but California had some dumb laws preventing building of new construction. Thus low supply and high demands', 'UgzXbzLVxBnQ4fjwtmF4AaABAg', '@JohnnyKReviews', 0.0);
