INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text, parent_id, author_name, like_count) VALUES ('3f542590-dd4d-4f42-8b78-71cff91340c9', 'costa-mesa-border', 'youtube', 'Ugysxh56dByWnZjJaLh4AaABAg', NULL, '2025-12-21 04:36:35', NULL, 'If you work in the morning, I''d suggest going across at around 3 am.  Once you get across to San Diego, pull over and park and take a nap until work.  I knew a guy I worked with that dud this.  He started his shift at 6am.  He would cross at around 3am, then park and take a nap for 2.5 hours until work time.', NULL, '@dzim8822', 0.0);
